/*Table structure for table `faqs` */

DROP TABLE IF EXISTS `faqs`;

CREATE TABLE `faqs` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(1024) COLLATE utf8_unicode_ci NOT NULL,
  `content` text COLLATE utf8_unicode_ci NOT NULL,
  `type` tinyint(3) unsigned NOT NULL DEFAULT '1',
  `visible` tinyint(3) unsigned NOT NULL DEFAULT '1',
  `cat_id` int(12) DEFAULT NULL,
  `order` int(12) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `faqs` */

insert  into `faqs`(`id`,`title`,`content`,`type`,`visible`,`cat_id`,`order`) values (16,'<en>What is Wawjob?</en><ch>Wawjob是什吗?</ch><kp>Wawjob이란 무엇인가?</kp>','<en>Wawjob is a world-class outsourcing platform which involves up to 1 million clients and freelancers across the spheres of IT technologies.  Especially, web application development is a top trend these days among most freelancers.</en>\n<kp>Wawjob은 IT령역을 통하여 백만명이상의 수요자들과 개발자들이 거래하는 세계적인 과제주문platform이다.</kp>',1,1,84,0),(17,'Who can use this Wawjob?','The answer to this question is quite simple, EVERYONE !<br>If you need to hire developers or you are looking for online jobs, you can just sign up our platform and start your new life as a client. <br><br>There are quite many chances to make your business much better than ever.  The same is true for developers who love career as freelancers.  A freelancer or (freelance worker) is a self-employed person working in a profession or trade in which full-time employment is also common.',1,1,84,2),(18,'How does it work?','We acquire 10% fee from all the contracts between clients and freelancers. Whether it is hourly or fixed-price contract, we get 10% from the payment by clients.\n\nHourly:  Every Monday, a new cycle for weekly hourly payment begins.\nClients can review work diaries of contractors they hired and they can request dispute or something else.\n\nFixed-price: This is the other type of contracts which is typically used for small to medium scale projects.  Clients set milestones that contractors should achieve in given periods.',1,1,84,1),(19,'Buyer','Please update this FAQ for Buyer.',0,1,86,1),(20,'Freelancer','Please update this FAQ for freelancer.',2,1,86,0),(21,'all','Please update this FAQ for all.',1,1,86,2);

/*Table structure for table `files` */

DROP TABLE IF EXISTS `files`;

CREATE TABLE `files` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `name` varchar(128) COLLATE utf8_unicode_ci NOT NULL,
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `ext` varchar(5) COLLATE utf8_unicode_ci NOT NULL,
  `size` bigint(20) NOT NULL,
  `path` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `uploaded_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `is_approved` tinyint(1) NOT NULL DEFAULT '1',
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `files_user_id_index` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

