/*Table structure for table `project_skills` */

DROP TABLE IF EXISTS `project_skills`;

CREATE TABLE `project_skills` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `project_id` int(10) unsigned NOT NULL,
  `skill_id` int(10) unsigned NOT NULL,
  `order` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `level` tinyint(3) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `project_skills_project_id_skill_id_index` (`project_id`,`skill_id`),
  KEY `project_skills_project_id_index` (`project_id`),
  KEY `project_skills_skill_id_index` (`skill_id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `project_skills` */

