/*Table structure for table `projects` */

DROP TABLE IF EXISTS `projects`;

CREATE TABLE `projects` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `category_id` int(10) unsigned NOT NULL,
  `client_id` int(10) unsigned NOT NULL,
  `subject` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `desc` text COLLATE utf8_unicode_ci NOT NULL,
  `type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '0: Fixed, 1: Hourly',
  `duration` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  `workload` varchar(10) COLLATE utf8_unicode_ci NOT NULL,
  `price` decimal(20,2) NOT NULL,
  `req_cv` tinyint(1) NOT NULL DEFAULT '1',
  `contract_limit` int(10) unsigned NOT NULL DEFAULT '0',
  `is_public` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '0: Closed, 1: Open',
  `reason` varchar(256) COLLATE utf8_unicode_ci NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `projects_category_id_index` (`category_id`),
  KEY `projects_client_id_index` (`client_id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `projects` */

insert  into `projects`(`id`,`category_id`,`client_id`,`subject`,`desc`,`type`,`duration`,`workload`,`price`,`req_cv`,`contract_limit`,`is_public`,`status`,`reason`,`created_at`,`updated_at`,`deleted_at`) values (1,3,7,'Wordpress Developer','Hi everybody, we are looking for senior wordpress devs here.\r\n\r\nAll of the application code was created using Visual Studio .NET and the C# programming language, while most of the database tasks were performed using the DB2 Development Add-in to Visual Studio .NET.',1,'MT6M','FT','0.00',0,10,1,0,'','2015-08-31 02:04:38','2016-04-12 08:54:52',NULL),(2,3,7,'Drupal Developer','Now, www.fixed.com looks for a talented Drupal developer for our new site.\r\nIt was built on Drupal 6 three years ago, but it requires to re-build to meet the new requirements of our company.\r\n\r\nWe will hire 2 developers within a week and start the contract.  Only Europeans required.',1,'LT1M','PT','0.00',1,2,1,1,'','2015-09-01 02:04:38','2015-09-01 02:04:40',NULL),(3,2,6,'URGENT: Senior Designer','Hi everybody, we are looking for senior designer.\r\n\r\nDevelopers using the Microsoft .NET Framework can easily leverage their existing knowledge to access information stored in a DB2 database using the new DB2 Managed Provider. \r\n\r\nThis tutorial shows how to create a stored procedure in DB2 and then incorporate it into a Web service built using Microsoft\'s Visual Studio .NET and C# (pronounced C Sharp). Finally, a simple ASP.NET application demonstrates how to access the web service to display the data over the Internet.',1,'LT1M','PT','0.00',0,1,1,1,'','2015-09-02 02:04:38','2015-09-02 02:04:40',NULL),(4,4,7,'Magento Developer','Hi everybody, we are looking for senior magento developer.\r\n\r\nThis tutorial demonstrates the techniques needed to build a Web service in C# that accesses an IBM DB2 Universal Database database using the DB2 managed data provider. The DB2 managed data provider offers capabilities similar to the SQL Server managed data provider as well as providing a high performance, secure way to access a DB2 database from any .NET programming language. \r\nThe DB2 managed data provider was written in C# by the DB2 Development organization to combine the best features and function of DB2, while exploiting the database neutral facilities included in the .NET Framework.\r\n\r\nThis sample application in this tutorial involves the JustPC.com Music Company, which maintains a database with information about various CDs it has for sale.\r\nThrough a Web service it provides, users can search the database to retrieve various kinds of information, including a list of artists, a list of CDs recorded by a specific artist and the list of tracks on the CD.',0,'','','5000.00',1,1,1,1,'','2015-10-01 10:04:38','2016-04-03 05:07:10',NULL),(5,5,6,'Should I take this tutorial?','In order to follow along with this tutorial, you will need to create an empty database called MUSIC using the DB2 Control Center. Simply use the Create Database Wizard and specify MUSIC as the name of the database. \r\nNo other information is required to create the database.\r\nNote: While this tutorial was created and tested on a single Windows 2000 Server system, you may choose to run Visual Studio .NET on a Windows 2000 or XP Professional system and copy the appropriate files to the Windows Server system for execution',0,'','AN','900.00',1,1,1,1,'','2015-10-02 10:26:38','2016-03-16 08:11:07',NULL),(6,3,7,'Overview of the sample application','The JustPC.com Music Company maintains a database with information about various CDs it has for sale. Through a Web service it provides, you can search the database to retrieve various kinds of information, including a list of artists, a list of CDs recorded by a specific artist, and the list of tracks on the CD.\r\n\r\nMySQL allows you to create a column of type CHAR(0). This is useful primarily when you have to be compliant with old applications that depend on the existence of a column but that do not actually use its value. CHAR(0) is also quite nice when you need a column that can take only two values: A column that is defined as CHAR(0) NULL occupies only one bit and can take only the values NULL and \'\' (the empty string). ',1,'1T3M','AN','0.00',1,1,1,0,'Cancelled by admin.','2015-10-02 10:26:38','2016-04-09 06:58:35',NULL),(7,4,6,'Looking for NetSuite developer','A TIMESTAMP column is useful for recording the date and time of an INSERT or UPDATE operation. By default, the first TIMESTAMP column in a table is automatically set to the date and time of the most recent operation if you do not assign it a value yourself. You can also set any TIMESTAMP column to the current date and time by assigning it a NULL value. Variations on automatic initialization and update properties are described here.\r\n\r\nA year in two-digit or four-digit format. The default is four-digit format. In four-digit format, the allowable values are 1901 to 2155, and 0000. In two-digit format, the allowable values are 70 to 69, representing years from 1970 to 2069. MySQL displays YEAR values in YYYY format, but allows you to assign values to YEAR columns using either strings or numbers. \r\n\r\nCharacter column sorting and comparison are based on the character set assigned to the column. (Before MySQL 4.1, sorting and comparison were based on the collation of the server character set.) For the CHAR, VARCHAR, TEXT, ENUM, and SET data types, you can declare a column with a binary collation or the BINARY attribute to cause sorting and comparison to use the underlying character code values rather than a lexical ordering. \r\n',0,'','PT','2400.00',1,0,1,1,'','2016-01-08 22:28:33','2016-03-27 06:57:39',NULL),(8,3,9,'Wawjob designer','Laravel is a web application framework with expressive, elegant syntax. We believe development must be an enjoyable, creative experience to be truly fulfilling. Laravel attempts to take the pain out of development by easing common tasks used in the majority of web projects, such as authentication, routing, sessions, queueing, and caching.\r\n\r\nLaravel is accessible, yet powerful, providing powerful tools needed for large, robust applications. A superb inversion of control container, expressive migration system, and tightly integrated unit testing support give you the tools you need to build any application with which you are tasked.\r\n',1,'3T6M','FT','0.00',1,2,1,1,'','2016-03-30 14:21:57','2016-03-30 14:21:57',NULL),(9,3,9,'Contract Price is not clear','Hi Kevin,\r\n\r\nWould you please check the price of new contract?  ',1,'MT6M','FT','0.00',1,6,1,1,'','2016-03-31 07:11:51','2016-03-31 07:11:51',NULL),(10,4,9,'$40/hr project','Hello, this is $40/hr project.',1,'1T3M','PT','0.00',0,1,1,1,'','2016-03-31 07:18:07','2016-03-31 07:18:07',NULL),(11,6,9,'Total Score?','Hello,\r\n\r\nI\'d like to calculate total score of freelancers.\r\n\r\nThanks.',0,'','','2500.00',0,2,1,1,'','2016-04-03 04:46:31','2016-04-03 04:46:31',NULL),(12,2,9,'$2000 project','Hehe, who made this ?????',0,'','','2000.00',1,9,1,1,'','2016-04-03 04:55:01','2016-04-04 07:15:53',NULL),(13,3,7,'Test Project','This is very good',1,'MT6M','FT','0.00',1,1,0,1,'','2016-04-08 07:04:14','2016-04-20 11:12:45',NULL),(14,4,7,'Looking for Shopping Mall','Our company is seeking a senior e-commerce developer who is skilled at Magento and Zencart.',1,'1T3M','AN','0.00',1,2,1,1,'','2016-04-19 08:52:49','2016-04-21 10:23:57',NULL),(15,32,7,'문장번역과제','중어 - 영어문장번역을 요청합니다.  과학기술원서 300페지, 문예도서 500페지.\r\n\r\n기간은 1달입니다.  2일내로 과제를 시작하려고 합니다.',0,'','','600.00',1,2,1,1,'','2016-04-22 07:54:41','2016-04-22 07:54:57',NULL),(16,3,9,'Wawjob - Submit A Proposal페지에서의 문제점','개발자가 Fixed-price job에 apply할 때 Submit A Proposal페지에 Job Posting에 밝힌 고정가격이 나와야 한다고 봅니다.\r\n',0,'','','10.00',0,1,1,1,'','2016-04-22 07:57:46','2016-04-22 07:57:46',NULL),(17,6,9,'CRITICAL!!!  Wawjob - Buyer / Message List (생각해봅시다)','1. 현재 Buyer로 로그인하여 Messages페지에 가보면 아래의 왼쪽목록에 모두 자기의 이름만 나옵니다.\r\nMessage Thread는 어떤 두 대상사이에 진행되는 대화내용의 목록이라고 볼수 있습니다.  그러므로 여기서 buyer자신이 아니라 대화상대인 freelancer의 이름이 현시되여야 합니다.\r\n\r\n2. 일부 message thread에 들어가보면 No Messages Found라는 통보문이 나옵니다.  이 경우는 Freelancer가 Job Posting에 apply만 했을 경우에 나오는데 이 경우가 옳지 않다고 봅니다.  쌍방사이에 아직 오고간 통보문이 하나도 없는 Message Thread가 과연 현시되여야 하겠는지?\r\n\r\n만일 신청한 개발자들에게 통보문을 새로 보내려면 Job Posting의 Applicants를 보는 페지에 Send Message단추가 있어야 한다고 생각합니다.',0,'','','20.00',0,1,1,1,'','2016-04-22 07:59:18','2016-04-22 08:03:15',NULL),(18,7,29,'Wawjob프로젝트에 대한 통합검사','입찰싸이트 Wawjob에서는 본 싸이트의 품질검사를 위하여 150명의 품질검사성원을 모집합니다.\r\n\r\n요구되는 기능은 다음과 같습니다.\r\n- HTML, PHP\r\n- 입찰싸이트에 대한 개념\r\n- Basecamp, JIRA, PivotalTracker 등 과제관리체계에 대한 리용경험\r\n\r\n1~2일내로 과제를 시작하려고 합니다. \r\n\r\n감사합니다.',1,'1T3M','FT','0.00',1,10,1,1,'','2016-04-27 10:09:56','2016-04-28 07:40:50',NULL),(19,33,29,'Creative Writing - 기사요청','Web관련기사 10건을 써야겠는데 좀 도와주십시오.\r\n\r\n',0,'','','345.00',0,2,1,1,'','2016-04-28 08:28:48','2016-04-28 08:28:48',NULL),(20,3,9,'서광동지와 명선동지에게 - HTML escaping','1) 서광동지: Messages페지에서 와 같은 HTML tag를 message내용안에 포함시켜 send해보십시오.  그러면 태그가 그대로 HTML페지에 rendering됩니다.\r\n\r\n2) 명선동지:   Job posting detail페지에서도 HTML태그가 섞이면 같은 현상이 나타납니다.\r\n\r\n:) thanks',0,'','','100.00',0,10,1,1,'','2016-04-28 09:00:57','2016-04-28 09:35:43',NULL),(21,23,9,'Fix Server Cache','I need a system admin, available now, to check server cache + checkup whole environment. Max 2 hrs work.',0,'','','450.00',1,3,1,1,'','2016-05-12 01:36:31','2016-05-12 01:36:31',NULL),(22,23,9,'SEO Project 027','100 PR3 backlinks \r\n\r\nREQUIREMENTS:\r\n- Backlinks with 100% white hat techniques only!\r\n- Links must be strictly from PR3+ pages - internal pages, iframe page with PR less than 3 wont count.\r\n- Links must be permanent.\r\n- One link per domain.\r\n- Links must be placed on proper PR3+ web pages, either on home page or internal pages. Page must be linked with Home page.\r\n- We will provide anchor text for all the backlinks.\r\n- Page must not be dis-allowed by robots.txt\r\n- All links must be static and standard href type links.\r\n- Only links from relevant sites will be accepted.\r\n- Links must be on a www, no sub domains.\r\n- Domains must be from different IP addresses and different Class-C IP addresses.\r\n- Links must be from English language websites only.\r\n- Link pages and our text links must be visible, readable, indexable and do-follow.\r\n- Link pages must be indexed and cached by all major search engines within last 60 days.\r\n- Backlinks must be search engine friendly, that is no redirects, cloaking and other practices\r\n- No link farms, no link-exchange programs, no banned sites, no illegal/scam/spam sites.\r\n- No exchange programs, web rings, rented links, FFA sites.\r\n\r\nRequired Skills: SEO',0,'','','600.00',0,3,1,1,'','2016-05-12 01:37:08','2016-05-12 01:42:23',NULL),(23,3,9,'Website Scraping Project','Hi,\r\n\r\nWe have a big project and are looking for some potential long term work.\r\nThe first project is to create a script that scrapes websites for content (articles etc.).\r\nWe have a list of 10 websites to start with.\r\n\r\nPlease make a bid and I will send you the project details. \r\n \r\nSkills required: Codeigniter, Javascript, MySQL, PHP',0,'','','2500.00',1,2,1,1,'','2016-05-12 01:39:25','2016-05-12 01:41:56',NULL),(24,3,9,'HTML/CSS Cutting Task','HTML/CSS cutting task is in a file attached.',1,'1T3M','PT','0.00',1,1,1,1,'','2016-05-12 01:40:13','2016-05-12 01:40:13',NULL),(25,3,9,'Joomla, Jomsocial, Paid membership site -Assistance Required','Hello everyone,\r\n\r\nI’m looking for someone to assist me complete a website project that I have started (Temporary location www.cctvkenya.info/foota) . I am also looking forward to long-term relationship as I have numerous such projects. And I’m price sensitive, so I’m also looking to go with the lowest bid possible.\r\n\r\nThe following skills will be required:\r\n• Joomla\r\n• Jomsocial\r\n• PHP\r\n• MySQL\r\n\r\nAbout the project:\r\nThe project involves creating a football/soccer 