/*Table structure for table `transactions` */

DROP TABLE IF EXISTS `transactions`;

CREATE TABLE `transactions` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `type` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '0: fixed, 1: hourly, 2: bonus, 3: charge, 4: withdrawal, 5: refund',
  `for` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1: From buyer, 2: To freelancer, 3: Fee',
  `user_id` int(10) unsigned NOT NULL,
  `contract_id` int(10) unsigned NOT NULL DEFAULT '0',
  `hourly_from` date DEFAULT NULL COMMENT 'Only for Hourly Job',
  `hourly_to` date DEFAULT NULL COMMENT 'Only for Hourly Job',
  `hourly_mins` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT 'Weekly minutes for hourly job',
  `note` varchar(512) COLLATE utf8_unicode_ci NOT NULL DEFAULT '',
  `amount` decimal(20,2) NOT NULL DEFAULT '0.00',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0: pending, 1: available',
  `done_at` timestamp NULL DEFAULT NULL,
  `ref_id` int(10) unsigned DEFAULT NULL COMMENT 'transactions.id',
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=128 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

