/*Table structure for table `user_profiles` */

DROP TABLE IF EXISTS `user_profiles`;

CREATE TABLE `user_profiles` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `title` varchar(256) COLLATE utf8_unicode_ci DEFAULT NULL,
  `desc` varchar(1028) COLLATE utf8_unicode_ci DEFAULT NULL,
  `rate` decimal(10,2) DEFAULT NULL,
  `en_level` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `share` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `availability` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '0: > 30hrs, 1: 10~30 hrs, 2: Not Available',
  `last6_total_mins` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Total minutes during last 6 months',
  `total_mins` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Total minutes by now',
  `total_score` decimal(3,2) DEFAULT '0.00' COMMENT 'Total score (not-available when NULL)',
  `metered_at` timestamp NULL DEFAULT NULL COMMENT 'Last timestamp when total minutes were metered.',
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_profiles_user_id_index` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `user_profiles` */

insert  into `user_profiles`(`id`,`user_id`,`title`,`desc`,`rate`,`en_level`,`share`,`availability`,`last6_total_mins`,`total_mins`,`total_score`,`metered_at`,`deleted_at`) values (1,1,'Administrator','As a programmer, chances are you’ve had to access a file system at some\r\npoint: reading files, writing files, renaming and deleting files. We’ll start our\r\nNode.js journey in this familiar area, creating useful, asynchronous file utili-ties. Along the way we’ll explore the following aspects of Node development.','20.00',0,0,0,0,0,'0.00',NULL,NULL),(2,2,'Welcome','Let’s enhance our file-watching example program even further by having it&nbsp;spawn a child process in response to a change. \r\nTo do this, we’ll bring in Node’s&nbsp;child-processmodule and dive into some Node patterns and classes. You’ll also&nbsp;learn how to use streams to pipe data around.<div>\r\nTo keep things simple, we’ll make our script invoke the lscommand with the&nbsp;-lhoptions.\r\n&nbsp;This will give us some information about the target file whenever&nbsp;it changes. You can use the same technique to spawn other kinds of processes,as well.\r\nOpen your editor and enter this:</div>','20.00',0,0,0,850,100,'4.00','2016-05-26 06:12:27',NULL),(3,5,'Senior Filemaker developer','a\r\nb\r\n\r\n','300.00',0,0,1,180,20,'1.39','2016-05-26 06:12:28',NULL),(4,3,'Php King!','Node.js couples JavaScript with an event loopfor quickly dispatching opera-tions when events occur. Many JavaScript environments use an event loop,\r\nbut it is a core feature of Node.js.\r\nNode’s philosophy is to give you low-level access to the event loop and to\r\nsystem resources. Or, in the words of core committer Felix Geisendörfer, in\r\nNode “everything runs in parallel except your code.”\r\n1\r\nIf this seems a little backwards to you, don’t worry. The following figure shows\r\nhow the event loop works.','22.00',0,0,0,0,0,'3.63','2016-05-26 06:12:28',NULL),(5,4,'?Nodejs Ghost?','The REQ/REP (request/reply) pattern is quite common in networked program-ming, particularly in Node. We’ll use this pattern often in the next couple of\r\nchapters, and ØMQ has great support for it. As you’ll see in a minute, this is\r\nwhere the “Q”of ØMQ becomes apparent.\r\nIn ØMQ, a REQ/REP pair communicates in lockstep. A request comes in,\r\nthen a reply goes out. Additional incoming requests are queuedand later\r\ndispatched by ØMQ. Your application, however, is only aware of one request\r\nat a time.\r\nLet’s see how this works, again using the file system as a source of information\r\nfor building a service. In this scenario, a responder waits for a request for file\r\ndata, then serves up the content when asked. We’ll start with the responder\r\n—the REP (reply) part of the REQ/REP pair.','25.00',0,0,0,0,0,'0.00','2016-05-26 06:12:28',NULL),(6,6,'Angular Prince','In multithreaded systems, doing more work in parallel means spinning up\r\nmore threads. But Node.js uses a single-threaded event loop, so to take\r\nadvantage of multiple cores or multiple processors on the same computer,\r\nyou have to spin up more Node processes.\r\nThis is called clusteringand it’s what Node’s built-in clustermodule does.\r\nClustering is a useful technique for scaling up your Node application when\r\nthere’s unused CPU capacity available. Scaling a Node application is a big\r\ntopic with lots of choices based on your particular scenario, but no matter\r\nhow you end up doing it, you’ll probably start with clustering.','38.00',0,0,0,0,0,'0.00','2016-04-17 22:52:38',NULL),(16,9,'Buyer (paulz)','I\'m a buyer.','0.00',0,0,0,60,60,'0.41','2016-04-04 08:12:00',NULL),(17,14,NULL,NULL,NULL,0,0,0,0,0,'0.00',NULL,NULL),(18,15,NULL,NULL,NULL,0,0,0,0,0,'0.00',NULL,NULL),(19,16,'6th freelancer created by paulz','6th freelancer created by paulz','36.00',0,1,0,0,0,'0.00','2016-04-04 09:25:19',NULL),(20,17,NULL,NULL,NULL,0,0,0,0,0,'0.00',NULL,NULL),(21,18,NULL,NULL,NULL,0,0,0,0,0,'0.00',NULL,NULL),(22,19,NULL,NULL,NULL,0,0,0,0,0,'0.00',NULL,NULL),(23,20,NULL,NULL,NULL,0,0,0,0,0,'0.00',NULL,NULL),(24,22,NULL,NULL,NULL,0,0,0,0,0,'0.00',NULL,NULL),(25,23,NULL,NULL,NULL,0,0,0,0,0,'0.00',NULL,NULL),(26,25,NULL,NULL,NULL,0,0,0,0,0,'0.00',NULL,NULL),(27,26,NULL,NULL,NULL,0,0,0,0,0,'0.00',NULL,NULL),(28,27,'Wordpress and Magento Developer','I have been developing the wordpress and magento sites for ten years.&nbsp;','0.00',0,0,0,0,0,'0.00','2016-04-26 09:43:28',NULL),(29,29,NULL,NULL,NULL,0,0,0,0,0,'0.00',NULL,NULL),(30,30,NULL,NULL,NULL,0,0,0,0,0,'0.00',NULL,NULL),(31,31,'Senior Filemaker Developer','During last 5 years, I have been working as a filemaker developer.\r\nPlease do not hestitate to \r\n','44.00',0,0,0,0,0,'0.00','2016-05-07 01:32:02',NULL),(32,32,NULL,NULL,NULL,0,0,0,0,0,'0.00',NULL,NULL);

